import React,{Component} from "react";
import '../css/TradingTopics.css'
import tradingTopicsbg from '../images/tradingTopicsbackground.'

class TradingTopics extends Component{
    render(){
        return(
            <div className="container-fluid tTopics">
                <h2 className="text-center">Multiple topics to trade on</h2>
            </div>
        );
    }
} 

export default TradingTopics;
